  display: flex;
  background-color: #f9f9f9;
  width: 308px;
  padding: 12px 14px;
  margin: 4px 26px;
  font-size: 24px;
  border-radius: 10px;

  text-align: center;
  &:hover {
    background-color: white;
    color: hotpink;
  }
`;

const nicknameStyle = css`
  font-family: Pretendard;
  font-style: normal;
  font-weight: 600;
  font-size: 16px;
  line-height: 161.7%;
  /* identical to box height, or 26px */

  color: #202020;
`;
const UserRow = () => {
  return (
    <div css={divStyle}>
      <div>1</div>
      <div className="user-row__profile-image">img</div>
      <div css={nicknameStyle}>Jason</div>
      <div className="user-row__score">99</div>
    </div>
  );
};

export default UserRow;
